			"text": "심상정 후보가 왜 시원하게 보이는가? 그것은 정의당의 집권 가능성이 없기 때문. 집권 가능성이 없으니 최상위 동맹국인 미국의 신임 대통령인 트럼프에 대해서도 디스하는 뉘앙스의 논평을 낼 수 있는 것. 진보의 '시원한 선언'의 특성이란 대체로 그러함.",
