		"id_str": "851737110277050368",
		"text": "판결의 단편적이고 자극적인 부분만 보고 평가하려는 독자들이 넘쳐나니 언론도 그렇게 보도하는 것인지, 아니면 언론이 그런 단편적이고 자극적인 부분만 보도하기 때문에 독자들도 그렇게 평가하려는 것인지 모르겠지만… 대부분은 그게 판결문의 전부인 줄 알더라.",
